drop table if exists gpa;
drop table if exists gpa;
drop table if exists eleves;
drop table if exists notes_details;
drop table if exists contentieux;

create table eleves (
nom varchar(255),
civil integer,
bac_code varchar(10),
bac_mention varchar(20),
entree_fil varchar(30),
entree_prep varchar(20),
personne_id varchar(50),
primary key (personne_id)
);

create table notes_details (
cycle varchar(9), 
sem varchar(5),
nom varchar(255), 
code_ue varchar(10),
moy_ue float,
grade_gpa float,
grade_ects varchar(2),
credits_ects integer,
session integer
);

create table gpa (
cycle varchar(9),
sem varchar(5),
nom varchar(255),
gpa float,
primary key (cycle, sem, nom)
);

create table contentieux (
cycle varchar(9),
sem varchar(5),
nom varchar(255),
code_ue varchar(10)
);

create table cesure (
nom varchar(255),
ces varchar(10)
);

